// Creating a expense item components
function ExpenseItems() {
  return (
    <div>
      <div>Date</div>
      <div>
        <h2>Title</h2>
        <div>Amount</div>
      </div>
    </div>
  );
}
// Exporting by default metjod so that it can be used in another components by importing

export default ExpenseItems;
